import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { CssBaseline, Box } from '@mui/material';
import Navbar from './components/Navbar';
import Dashboard from './components/Dashboard';
import LogUpload from './components/LogUpload';
import RuleManagement from './components/RuleManagement';
import IaCScanner from './components/IaCScanner';

// Art Deco Design System
const artDecoTheme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#D4AF37', // Metallic Gold
    },
    secondary: {
      main: '#1E3D59', // Midnight Blue
    },
    background: {
      default: '#0A0A0A', // Obsidian Black
      paper: '#141414', // Rich Charcoal
    },
    text: {
      primary: '#F2F0E4', // Champagne Cream
      secondary: '#888888', // Pewter
    },
  },
  typography: {
    fontFamily: '"Josefin Sans", "Helvetica", "Arial", sans-serif',
    h1: {
      fontFamily: '"Marcellus", serif',
      textTransform: 'uppercase',
      letterSpacing: '0.2em',
      fontWeight: 400,
    },
    h2: {
      fontFamily: '"Marcellus", serif',
      textTransform: 'uppercase',
      letterSpacing: '0.15em',
      fontWeight: 400,
    },
    h3: {
      fontFamily: '"Marcellus", serif',
      textTransform: 'uppercase',
      letterSpacing: '0.1em',
      fontWeight: 400,
    },
    h4: {
      fontFamily: '"Marcellus", serif',
      textTransform: 'uppercase',
      letterSpacing: '0.1em',
      fontWeight: 400,
    },
    h5: {
      fontFamily: '"Marcellus", serif',
      textTransform: 'uppercase',
      letterSpacing: '0.05em',
      fontWeight: 400,
    },
    h6: {
      fontFamily: '"Marcellus", serif',
      textTransform: 'uppercase',
      letterSpacing: '0.05em',
      fontWeight: 400,
    },
    body1: {
      fontSize: '1.125rem',
      lineHeight: 1.6,
    },
  },
  shape: {
    borderRadius: 0, // Sharp corners for Art Deco
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          borderRadius: 0,
          textTransform: 'uppercase',
          letterSpacing: '0.2em',
          fontWeight: 500,
          minHeight: 48,
          border: '2px solid #D4AF37',
          transition: 'all 0.3s ease',
          '&:hover': {
            boxShadow: '0 0 20px rgba(212, 175, 55, 0.4)',
            transform: 'translateY(-2px)',
          },
        },
        contained: {
          backgroundColor: '#D4AF37',
          color: '#0A0A0A',
          '&:hover': {
            backgroundColor: '#F2E8C4',
          },
        },
        outlined: {
          borderColor: '#D4AF37',
          color: '#D4AF37',
          backgroundColor: 'transparent',
          '&:hover': {
            backgroundColor: '#D4AF37',
            color: '#0A0A0A',
          },
        },
      },
    },
    MuiCard: {
      styleOverrides: {
        root: {
          backgroundColor: '#141414',
          border: '1px solid rgba(212, 175, 55, 0.3)',
          borderRadius: 0,
          position: 'relative',
          transition: 'all 0.5s ease',
          '&:hover': {
            borderColor: '#D4AF37',
            transform: 'translateY(-8px)',
            boxShadow: '0 0 15px rgba(212, 175, 55, 0.2)',
          },
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 8,
            right: 8,
            width: 16,
            height: 16,
            borderTop: '2px solid rgba(212, 175, 55, 0.5)',
            borderRight: '2px solid rgba(212, 175, 55, 0.5)',
            transition: 'opacity 0.3s ease',
          },
          '&::after': {
            content: '""',
            position: 'absolute',
            bottom: 8,
            left: 8,
            width: 16,
            height: 16,
            borderBottom: '2px solid rgba(212, 175, 55, 0.5)',
            borderLeft: '2px solid rgba(212, 175, 55, 0.5)',
            transition: 'opacity 0.3s ease',
          },
          '&:hover::before, &:hover::after': {
            opacity: 1,
          },
        },
      },
    },
    MuiTextField: {
      styleOverrides: {
        root: {
          '& .MuiOutlinedInput-root': {
            backgroundColor: 'transparent',
            borderRadius: 0,
            '& fieldset': {
              border: 'none',
              borderBottom: '2px solid #D4AF37',
            },
            '&:hover fieldset': {
              borderBottom: '2px solid #F2E8C4',
            },
            '&.Mui-focused fieldset': {
              borderBottom: '2px solid #F2E8C4',
              boxShadow: '0 4px 10px rgba(212, 175, 55, 0.2)',
            },
          },
          '& .MuiInputLabel-root': {
            color: '#888888',
            textTransform: 'uppercase',
            fontSize: '0.875rem',
            letterSpacing: '0.1em',
            '&.Mui-focused': {
              color: '#D4AF37',
            },
          },
        },
      },
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={artDecoTheme}>
      <CssBaseline />
      <Box
        sx={{
          minHeight: '100vh',
          background: `
            linear-gradient(45deg, transparent 25%, rgba(212, 175, 55, 0.03) 25%, rgba(212, 175, 55, 0.03) 50%, transparent 50%, transparent 75%, rgba(212, 175, 55, 0.03) 75%),
            linear-gradient(-45deg, transparent 25%, rgba(212, 175, 55, 0.03) 25%, rgba(212, 175, 55, 0.03) 50%, transparent 50%, transparent 75%, rgba(212, 175, 55, 0.03) 75%),
            radial-gradient(circle at 50% 0%, rgba(212, 175, 55, 0.1) 0%, transparent 50%),
            #0A0A0A
          `,
          backgroundSize: '60px 60px, 60px 60px, 100% 100%, 100% 100%',
        }}
      >
        <Router>
          <Box sx={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
            <Navbar />
            <Box component="main" sx={{ flexGrow: 1, p: 0 }}>
              <Routes>
                <Route path="/" element={<Navigate to="/dashboard" replace />} />
                <Route path="/dashboard" element={<Dashboard />} />
                <Route path="/logs" element={<LogUpload />} />
                <Route path="/rules" element={<RuleManagement />} />
                <Route path="/scanner" element={<IaCScanner />} />
              </Routes>
            </Box>
          </Box>
        </Router>
      </Box>
    </ThemeProvider>
  );
}

export default App;
